build 0 = zero
build n = (AST Succ [build (n - 1)])

(!?) [] _ = Nothing
(!?) l 0 = Just $ head l
(!?) l i = (tail l) !? (i - 1)

zero = (AST Zero [])
one = build 1
two = build 2

targetPlusOne av =
    (AST Plus [av, one])
    
targetSq t =
    (AST Mul [t, t])

finalExpr av =
    (AST Equals [(targetSq (targetPlusOne av)), targetPlusOne (AST Plus [targetSq av, (AST Mul [two, av])])])

main = do
    args <- getArgs
    hIn <- fromMaybe (return stdin) $ fmap (\t -> openFile t ReadMode) (args !? 1)
    hOut <- fromMaybe (return stdout) $ fmap (\t -> openFile t WriteMode) (args !? 2)
    num <- (hGetLine hIn) >>= (return . read)
    hPutStrLn hOut $ "|-" ++ (show $ finalExpr $ build num)
    mapM (hPutStrLn hOut) (L.map show proof)
    hPutStrLn hOut $ "@a((((a)+((0)'))*((a)+((0)')))=((((a)*(a))+((((0)')')*(a)))+((0)')))->" ++ (show $ finalExpr $ build num)
    hPutStrLn hOut $ (show $ finalExpr $ build num)
    hClose hOut
    return ()

